        info_tnc_g_title: "Errors and Omissions",
        info_tnc_g_desc:
          "You will inform us as soon as you discover any error in your account and you will forfeit any amounts shown in your account resulting from human or technical error.",
        info_tnc_h_title: "Suspension and Termination",
        info_tnc_h_desc:
          "We may, at our sole discretion, suspend or terminate your account at any time, with or without cause, upon notice. You may terminate your account at any given time. Just contact our Customer Service should you wish to do so. We may block you from betting or using our services if you are found to be operating in areas outside our legal jurisdiction. We reserve the right to conduct an investigation on any suspicious activities with regards to your account. Upon the determination of any investigation, we reserve the right to seize some or all of the funds in your account if you are found to have violated any of the provisions of the Terms and Conditions. Should it be required, we may suspend your account immediately.",
        info_tnc_i_title: "Severability",
