        info_tnc_k_title: "Betting\nGeneral Conditions\n",
        info_tnc_k_desc:
          'LuckyBangla88 offers a platform where players may enter into various betting transactions in relation to the markets available on our sites.\nWhere players bet using our services, LuckyBangla88 acts as a facilitator and does not act as a counterparty.\nYou may enter into betting transactions through our website or through our mobile application;\n \nIn these General Conditions when we refer to "the Services" we mean all the services listed above (where applicable).\nIn these General Conditions references to "LuckyBangla88", "we", "us" and/or "our" are to whichever LuckyBangla88 is providing the Services to you as set out in the Specific Conditions applicable to your betting transaction.\nPlease read these General Conditions, and the Specific Conditions applicable to you and your betting transaction carefully before entering into any betting transactions.\nPlease note that there are separate Rules and Regulations for each of our exchange and products. The rules governing how markets are offered, managed and/or settled are not the same for every market on each product. In certain circumstances, a bet that is settled as a winner on one product may be settled as a loser on the other product (and vice versa). Additionally, different settlement rules may apply so that, for example, bets that are a winner on one product may be settled as a dead heat or be voided on the other product. Users must ensure that they familiarize themselves with the relevant rules that apply to the bets that they place on LuckyBangla88.\nShould there be any inconsistencies between the documents mentioned, this document, and the relevant Specific Conditions, the Specific Conditions will prevail over this document, and this document will prevail over the documents listed above.\n',
        info_tnc_l_title: "Conditions on Using LuckyBangla88",
